val videos = spark.read.parquet("/data/USvideos.parquet");
val tags = spark.read.format("com.databricks.spark.avro").load("/data/Tags.avro");
videos.createOrReplaceTempView("videos")
tags.createOrReplaceTempView("tags")
val trendingUniqueVideos = spark.sql("SELECT video_id, title, channel_title, category_id, publish_time, thumbnail_link, comments_disabled, ratings_disabled, video_error_or_removed, MAX(views) AS views, MAX(likes) AS likes, MAX(dislikes) AS dislikes FROM videos GROUP BY video_id, title, channel_title, category_id, publish_time, thumbnail_link, comments_disabled, ratings_disabled, video_error_or_removed")
trendingUniqueVideos.createOrReplaceTempView("trendingUniqueVideos")
